<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta
      name="viewport"
      content="width=device-width,initial-scale=1,user-scalable=no"
    />
    <title>A Candy Wonderland</title>
    <style>
      /* Global Styles */
      body,
      html {
        position: relative;
        font-family: Helvetica;
        margin: 0;
        padding: 0;
        overflow-y: auto;
      }

      main {
        position: relative;
        -webkit-overflow-scrolling: touch;
        scrollbar-width: none;
        height: 100dvh;
        overflow-y: scroll;
      }

      button:hover {
        cursor: pointer;
      }

      /* Header Section */
      .header {
        padding: 30px 0 20px;
        display: flex;
        justify-content: center;
        align-items: center;
        flex-direction: column;
        gap: 35px;
        position: relative;
        z-index: 2;
      }

      .header img {
        width: 50%;
        height: auto;
        object-fit: contain;
      }

      .logo {
        width: 30% !important;
      }

      .header h1 {
        margin: 0;
        font-size: 24px;
        letter-spacing: 5px;
      }

      /* CTA Button */
      .cta-button {
        border: none;
        border-radius: 30px;
        font-size: 16px;
        cursor: pointer;
        background: transparent;
        width: 50%;
        padding: 0;
        z-index: 2;
      }

      .cta-button img {
        width: 100%;
      }

      /* Footer Section */
      .footer {
        background-color: #f5f5f59d;
        position: relative;
        padding-top: 30px;
        display: flex;
        flex-direction: column;
        align-items: center;
        gap: 20px;
        width: 100%;
      }

      .footer img {
        width: 80%;
        height: auto;
        object-fit: contain;
      }

      .footer-text {
        width: 75% !important;
      }

      .footer p {
        font-size: 12px;
        margin: 5px 0;
      }

      /* Fixed Button Container */
      .fixed-button-container {
        background-color: #f5f5f59d;
        position: sticky;
        display: flex;
        align-items: center;
        justify-content: center;
        padding: 20px 0;
        bottom: 0;
        width: 100%;
        z-index: 3;
      }

      .fixed-button-container button {
        padding: 0;
        border-radius: 40px;
        width: 80%;
        border: none;
        background: transparent;
      }

      .fixed-button-container button img {
        width: 100%;
        height: 100%;
      }

      /* Top Container */
      .top-container {
        position: relative;
        display: flex;
        flex-direction: column;
        align-items: center;
        gap: 15px;
        height: 420px;
      }

      .top-container p {
        position: relative;
        text-align: center;
        margin: 0;
        z-index: 2;
        font-size: 100%;
      }

      /* Background Image */
      .background-top {
        width: 100%;
        position: absolute;
        height: 100%;
        object-fit: fill;
        inset: 0;
        z-index: 1;
      }

      /* Tabs */
      .tabs {
        position: relative;
        z-index: 1;
        width: 70%;
      }

      /* Products Section */
      .products-section {
        position: relative;
        display: flex;
        flex-direction: column;
        justify-content: space-between;
        align-items: center;
        gap: 20px;
        padding: 20px 0;
        width: 100%;
        overflow-x: hidden;
      }

      .products-section > img:first-child {
        position: absolute;
        inset: 0;
        z-index: 1;
        width: 100%;
        height: 100%;
      }

      .products-title {
        position: relative;
        z-index: 2;
        width: 80% !important;
        margin: 10px auto 0;
      }

      .products-section-grid {
        padding: 10px 20px;
        display: grid;
        grid-template-rows: 1fr 1fr;
        grid-template-columns: 1fr 1fr;
        gap: 20px;
        z-index: 2;
      }

      .product {
        position: relative;
        width: 100%;
      }

      .product img {
        width: 100%;
      }

      .product button {
        position: absolute;
        z-index: 2;
        bottom: 5px;
        left: 50%;
        transform: translateX(-50%);
        width: 100%;
        height: 30px;
      }

      /* Media Queries for Desktop */
      @media (min-width: 1024px) {
        .header {
          padding: 100px 0 50px;
          gap: 50px;
        }

        .header img {
          width: 60%;
        }

        .logo {
          width: 35% !important;
        }

        .top-container {
          gap: 50px;
          height: 140%;
        }

        .background-top {
          height: 100%;
          object-fit: cover;
          object-position: 10% 100%;
        }

        .top-container p {
          font-size: 36px;
        }

        .tabs {
          width: 40%;
        }

        .footer {
          padding: 80px 0;
          gap: 60px;
        }

        .footer img {
          width: 60%;
        }

        .footer-text {
          width: 55% !important;
        }

        .footer p {
          font-size: 24px;
        }

        .fixed-button-container {
          padding: 30px 0;
        }

        .fixed-button-container button {
          width: 40%;
        }

        .cta-button {
          width: 25%;
          height: 10%;
        }

        .products-section {
          gap: 60px;
          padding: 90px 0;
        }

        .products-title {
          width: 50% !important;
        }

        .product img {
          width: 90%;
        }

        .product button {
          width: 80%;
          height: 70px;
          margin: 0 auto;
        }
      }

      /* Media Queries for Small Devices */
      @media (max-width: 380px) {
        .background-top {
          object-fit: fill;
        }

        .top-container p {
          font-size: 70% !important;
        }
      }
    </style>
  </head>

      if (window.mraid && mraid.getState() !== "loading") {
        const buttons = [...document.querySelectorAll("button")];
        buttons.forEach((button) => {
          button.addEventListener("click", (event) => {
            const url = "https://mood.com/";
            mraid.open(url);

        });
